import React from 'react';
import {Form, Button, Col, fieldset, Row, Navbar} from 'react-bootstrap';
import Menu from './components/Menu';
import {CustomButton, CustomButton2} from '../../styled';

function Header() {
	return(
		<>
	        <Menu />
			<div>
				    <CustomButton
				      href="https://github.com/styled-components/styled-components"
				      target="_blank"
				      rel="noopener"
				      primary
				    >
				      GitHub
				    </CustomButton>
			</div>
		</>
	);
}

export default Header;
